import React, {Component} from 'react';
import { Link } from 'react-router-dom';
import padrao from './models/IronMan.patt';
import obj from './models/IronMan.obj';
import mtl from './models/IronMan.mtl';

class TelaRA  extends Component {

    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col">
                        <div className="conteinerRA">
                            <a-scene className="aframebox" embedded arjs="sourceType: webcam;">
                                <a-assets>
                                    <a-asset-item id="ironman-obj" src={obj}></a-asset-item>
                                    <a-asset-item id="ironman-mtl" src={mtl}></a-asset-item>
                                </a-assets>
                                <a-marker type="pattern" url={padrao}>
                                    <a-entity obj-model="obj: #ironman-obj; mtl: #ironman-mtl"> </a-entity>
                                </a-marker>
                                <a-entity position="0 0 3.8" >
                                    <a-camera></a-camera>
                                </a-entity>
                            </a-scene>
                        </div>
                    </div>
                </div>
                <div className="row">
                    <div className="col text-center">
                        <Link to="/inicio">
                            <span className="btn btn-primary">Voltar</span>
                        </Link>
                    </div>
                </div>
            </div>
        );
    }
}

export default TelaRA;
